<h1>Planck's constant</h1>
<a href=""http://en.citizendium.org/wiki/Planck%27s_constant"">http://en.citizendium.org/wiki/Planck%27s_constant</a>
<hr />
<h1>Planck's constant</h1>
<hr />
<br />
<p>The <strong>Planck constant</strong> (denoted <strong>h</strong>) is a natural constant named after Max Planck, one of the founders of quantum theory. Its value is approximately h = 6.63 × 10<small>-34</small> J s. A closely-related quantity is the <strong>reduced Planck constant</strong> (also known as <strong>Dirac's constant</strong> and denoted <strong>ħ</strong>, pronounced ""h-bar""). </p>

<p>Planck discovered in 1901 his constant in his study of black-body radiation. He found that the energy of this electromagnetic radiation consists of quanta of energy hν, where ν is the frequency of the radiation. These quanta are now called photons. The Planck constant is ubiquitous in quantum mechanics. For instance, it appears in the Schrödinger equation. Its small size is the main reason that quantum effects are o");
            WriteLiteral(@"nly noticeable for microscopic particles such as electrons and nuclei. </p>

<h2>Units, value and symbols</h2>
<hr />
<p>The Planck constant has dimensions of energy multiplied by time, which are also the dimensions of action. In SI units, the Planck constant is expressed in joule-seconds. The dimensions may also be written as momentum times distance (N·m·s), which are also the dimensions of angular momentum. </p>
<p>The value of the Planck constant is: </p>
<img src=""http://en.citizendium.org/images/math/d/5/b/d5bbc402fd2287fc8fd2b44401dd5ce4.png"" />
<p>The two digits between the parentheses denote the standard uncertainty in the last two digits of the value. </p>
<p>The value of the Dirac constant is: </p>
<img src=""http://en.citizendium.org/images/math/3/f/3/3f3efae4b3f5c84f7800beca5cca81ae.png"" />
<br />
<br />
<h3>Footnotes</h3>
<hr />
